import { Flex, Text, Center, Image } from "@chakra-ui/react";
import {logoo} from '../../src/'

export const Header = () => {
  return (
    <Flex color='white'>
      <Center w='100%' bg='white' boxShadow='base' h='100px'>
        <Text>Box 1</Text>
        <Image src='https://bit.ly/dan-abramov' alt='Dan Abramov' />

      </Center>
    </Flex>

  )
}
